#!/bin/bash
#In the above, the first character in the MD5 hash is derived from the hash of the corresponding level group (e.g 1_5, 11_15).	    
#The overarching theme is what text file or directory does not go with the others?
#based on first character in MD5 hash, level will have different text files, different directories, different subdirectories, different text file content, and different overall themes. 
#For everyone, level can behave very differently. The textfiles and directories the user sees, the themes of the content, and the contents of those text files and directories themselves all permute depending on the first hash character.
#Goes through numbers 0-9 and users a-z lowercase and capital (all alphanumeric possibilities for the first character of the MD5 hash)
#The count number is declared as an integer variable (noiseamount1-4) that permutates depending on what first character in MD5 hash the player has. They correspond to the do while loops that create main directories, subdirectories, and text flies that they see.
#Password spot, which is a random number in a given range permutates depending on the first character of the player's MD5 hash and the actual corresponding count amount (called noiseamount) specified in those conditions.
#There are sixteen variations here just like in other levels. These variations differ in the textfile names that they use as well as the arrays they call upon (which chang the textfile names and the directories they see). 
#Between the sixteen variations, players are cding in and out of directories of different themes and reading text files to find the passcode. We simply tell them to look into what stands out from others.
#Level variant identifiers out of the 16 possibilities, level_a - level_p, are commented into each corresponding elif condition.



changer=${MD531_35:0:1}


if [ "$changer" == "1" ] || [ "$changer" == "2" ] || [ "$changer" == "3" ] || [ "$changer" == "4" ]
		then
	        directory1="44448888222222" #level35a
        directory2="55555566666667*"
        directionsline1="Not so fast. You're now in Megabank's user and account number directory."
        directionsline2="The password is hidden in a text file within a subdirectory. The name of the game here is"
        directionsline3="what directory or file doesn't go with the others?"
        directionsline4="What sticks out?"
		# directionsline4="Look in directories $directory1 and $directory2"
        #Consult Prof. Giacobe if we want them to know what directories to look in
		    declare -i noiseamount1=10
		    declare -i noiseamount2=10
        declare -i noiseamount3=10
		declare -i noiseamount4=10
        textfilename="mememe.txt"
        password_spot1=$[RANDOM%10];
        password_spot2=$[RANDOM%10];
        password_spot3=$[RANDOM%10];
          
